// Funciones

function saludar(nombre) {
  return `Hola ${nombre}, ¿cómo estás?`;
}

console.log(saludar("Fernando"));

const saludar2 = (nombre) => `Hola ${nombre}, ¿cómo estás?`;

console.log(saludar2("Fernando"));
